import React from "react";

const HorizonLine = () => {
  return (
    <div
      style={{
        width: "100%",
        textAlign: "center",
        borderBottom: "1px solid #aaa",
        lineHeight: "0.1em",
        margin: "10px 5px 5px 20px",
      }}
    >
    </div>
  );
};

export default HorizonLine;
